import { gql } from "@apollo/client";

const COUNTRIES_QUERY = gql`
query Counties {
  countries {
    name
    code
    capital
    currency
    continent {
      name
      code
    }
    languages {
      code
      name
    }
  }
}
`;

export default COUNTRIES_QUERY;
